import { Button, Grid, TextField, VFlow } from "bold-ui";
import React from "react";

export function FormLogin() {
  return (
    <Grid
      alignItems="center"
      direction="row"
      gap={2}
      gapVertical={1}
      justifyContent="center"
      wrap
    >
      <VFlow vSpacing={1}>
        <TextField label="Usuário" placeholder="CPF" required />
        <TextField label="Senha" placeholder="Senha" type="password" required />
        <Button kind="primary" size="medium">
          Entrar
        </Button>
      </VFlow>
    </Grid>
  );
}
